import * as S from "./styles";
import Card from "../Card";

const Works = () => {
  return (
    <S.Works>
      <h1 className="title">Projects</h1>
      <div className="order">
        <Card
          name={"Trelo Board"}
          desc={
            "popular project management tool that utilizes a visual board-based system to help teams organize tasks and collaborate effectively. Users can create customizable boards, add lists, and populate them with cards representing individual tasks, making it easy to track progress and stay organized."
          }
          gitlink={""}
          demo={""}
        />
        <Card
          name={"Gif Finder"}
          desc={
            "You can search for any gif you would like, make your day funnier and sunnier. "
          }
          gitlink={""}
          demo={""}
        />
        <Card
          name={"Presentation WebSite"}
          desc={"Presentation website for a solar panels company. "}
          gitlink={""}
          demo={""}
        />
        <Card
          name={"Scoreboard"}
          desc={
            "Keep track of anyone's points in a game, inputing their names."
          }
          gitlink={""}
          demo={""}
        />
      </div>
    </S.Works>
  );
};

export default Works;
